import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import { Link } from 'react-router-dom';
import "../App.css"


function CollapsibleExample() {
  return (
    // // <Navbar sticky="top" collapseOnSelect expand="lg" variant='darkgreen' style={{backgroundColor:"white"}}>
    // //   <Container>
    // //     <Navbar.Brand href="/Home">
    // //     <img src="Images/Tesla1.png" alt="website logo"style={{width:150, marginTop: -7 , margin: 0}} />
    // //     </Navbar.Brand>
    // //     <Navbar.Toggle aria-controls="responsive-navbar-nav" />
    // //     <Navbar.Collapse id="responsive-navbar-nav">
    // //       <Nav className="me-auto" style={{marginLeft:30}}>
    // //         <Nav.Link to="/Home">Home</Nav.Link>
    // //         <Link to="/EvProducts.jsx">EV Products</Link>
    // //         <Nav.Link href="/EvCourses">EV Courses</Nav.Link>
    // //         <NavDropdown title="EV Extras">
    // //           <NavDropdown.Item className="collasible-nav"href="/EvFranchise">Ev Franchise</NavDropdown.Item>
    // //           <NavDropdown.Item className="collasible-nav" href="/EvCoeMou">
    // //           EV COE & MOU
    // //           </NavDropdown.Item>
    // //           <NavDropdown.Item className="collasible-nav" href="/EvJobs">
    // //             EV Jobs
    // //           </NavDropdown.Item>
    // //           <NavDropdown.Item className="collasible-nav" href="/EvRetro">
    // //             EV Retro
    // //           </NavDropdown.Item>
    // //           <NavDropdown.Item className="collasible-nav" href="EvApp">
    // //             EV App
    // //           </NavDropdown.Item>
    
    // //           <NavDropdown.Item className="collasible-nav" href="/EvOnlineTest">
    // //            EV Online Test
    // //           </NavDropdown.Item>
    // //         </NavDropdown>
    // //       </Nav>
    // //       <Nav  className = "me-auto1"style={{marginLeft:30}}>
    // //         <Nav.Link href="/Gallery">Gallery</Nav.Link>
    // //         <Nav.Link eventKey={2} href="/AboutUs">
    // //           About Us
    // //         </Nav.Link>
    // //         <Nav.Link href="/ContactUs">Contact Us</Nav.Link>
    // //       </Nav>
    // //     </Navbar.Collapse>
    // //   </Container>
    // // </Navbar>
    // <>

    <>
    <nav class="navbar navbar-expand-lg navbar-light bg-light">
  <a class="navbar-brand" href="#">Navbar</a>
  <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavDropdown" aria-controls="navbarNavDropdown" aria-expanded="false" aria-label="Toggle navigation">
    <span class="navbar-toggler-icon"></span>
  </button>
  <div class="collapse navbar-collapse" id="navbarNavDropdown">
    <ul class="navbar-nav">
      <li class="nav-item active">
        <a class="nav-link" href="#">Home <span class="sr-only">(current)</span></a>
      </li>
      <li class="nav-item">
        <a class="nav-link" href="#">Features</a>
      </li>
      <li class="nav-item">
        <a class="nav-link" href="#">Pricing</a>
      </li>
      <li class="nav-item dropdown">
        <a class="nav-link dropdown-toggle" href="#" id="navbarDropdownMenuLink" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
          Dropdown link
        </a>
        <div class="dropdown-menu" aria-labelledby="navbarDropdownMenuLink">
          <a class="dropdown-item" href="#">Action</a>
          <a class="dropdown-item" href="#">Another action</a>
          <a class="dropdown-item" href="#">Something else here</a>
        </div>
      </li>
    </ul>
  </div>
  <div className="collapse navbar-collapse justify-content-end" id="navbarNav">
       <ul className="navbar-nav " >
         <li className="nav-item">
           <Link className="nav-link" aria-current="page" to="/Home" >Home</Link>
         </li>
         <li className="nav-item">
           <Link className="nav-link" to="/Services" >Services</Link>
         </li>
         <li className="nav-item">
           <Link className="nav-link" to="/About">AboutMe</Link>
         </li>
         <li className="nav-item">
           <Link className="nav-link" to='/Contact'>ContactUs</Link>
         </li>
       </ul>
     </div>
</nav>
   
   

 
 
     
     </>
  );
}

export default CollapsibleExample;
